template <class BaseType, size_t FracDigits>
class fixed_point
{
    const static BaseType factor = 1 << FracDigits;

    BaseType data;

    long unsigned int mask;

public:
    size_t f = FracDigits;
    fixed_point(double d)
    {
        *this = d; // calls operator=
        mask = pow(2,sizeof(data)*8)-1;
    }

    fixed_point& operator=(double d)
    {
        data = static_cast<BaseType>(round(d*factor));
        return *this;
    }

    BaseType get_data() const
    {
        return data;
    }
    fixed_point()
    {
         *this = 0;// calls operator=
         mask = pow(2,sizeof(data)*8)-1;
    }
    long unsigned int operator+(fixed_point a)
    {

    	//LIMITE 64 BIT PER ORA, PENSACI DOPO SE SERVE

    	unsigned int data = (this->get_data()&this->mask) << (sizeof(this->get_data())*8);
    	data |= (a.get_data()&mask);
    	return data;
    }
    // Other operators can be defined here
};


